import React from 'react';

const SearchBox = ({ onSearch, onKeyDown }) => {
    return (
        <div>
            <input id="searchbox" onKeyDown = {onKeyDown} type="search" placeholder="pokemon name" />
            <button id="searchbtn" onClick={onSearch} type="button">Search</button>
        </div>
    )
}

export default SearchBox;
